import React from "react";
import KickEnvelopeContainer from "./KickEnvelopeContainer";
import OscControlsContainer from "./OscControlsContainer";
import SequencerContainer from "../containers/SequencerContainer";

class KickContainer extends React.Component {
  state = {};
  render() {
    return (
      <div className="container">
        <div>
          <KickEnvelopeContainer />
        </div>
        <div>
          <OscControlsContainer />
        </div>
        <br />
        <SequencerContainer />
      </div>
    );
  }
}

export default KickContainer;
